<!doctype html>
<html>
<head>
  <meta charset="utf-8" />
  <script>
    // spa-github-pages fallback
    (function(l){ if(l.search){var q={}; l.search.slice(1).split('&').forEach(function(v){var a=v.split('=');q[decodeURIComponent(a[0])]=decodeURIComponent(a[1]||'');}); 
    if(q.p){window.history.replaceState(null,null,q.p+(q.q?('?'+q.q):'')+(q.h?('#'+q.h):''));}}})(window.location)
  </script>
  <meta http-equiv="refresh" content="0; url=/frontend/" />
</head>
<body></body>
</html>
